(6,'5815167baaf7bedb86402855178b9d91',2,'Blu e bianca, le ho prese entrambe. Quella bianca mi aveva dato dei problemi in quanto non funzionava, ma amazon prontamente me l ha sostituita in un batti baleno. Ora sono entrambe perfette, funzionano benissimo, sono comodissime e 16GB sono pur sempre 16GB.',5,'2018-01-26',5),
