(56,'358ef9e90e59dedf4571db23b9b86322',8,'Ok, like the title says; It s Windows XP SP2. So what don t we all know about it by this point in time?Personally I prefer to use my Macs over my PC, but this purchase was for my dad so he could still use Quicken 2008 and Family Tree Maker on his new iMac. Neither of those programs are well represented on the Mac, so Dad prefers to use Parallels running Windows XP to use the versions from his newly retired Windows notebook. It s a workable but clumsy solution until better Mac versions become available.There nothing new to say about Windows XP SP2 that isn t common knowledge now. It is less expensive to use for running VMs like Parallels because of Microsoft s greedy licensing of Vista that requires purchasing Vista Ultimate, the most expensive version of Vista ($219.99), to be permitted run Vista in a VM. I think that is shameless price gouging on Microsoft s part.',3,'2018-01-26',3),
(57,'a4174fca3c0c431a6e44dc3e875a9709',9,'As Expected',3,'2018-01-26',3),
(58,'2c4c300d2732a5347aa80ca4abcdd6db',9,'I bought the¬†ASUS Eee PC 901 8.9-Inch Netbook (1 GB RAM, 20 GB Solid State Drive, Linux¬†and dealing with Linux on this machine is a nightmare.  So, I broke down and decided to XP it.  Far better than the mess that was on there.If you have the Linux version, the only plus is that you have more drive space.  Wipe it out, and this is the XP disc you need.  It is in fact the full version, and there is nothing different about it except it comes in a sleeve.Do not throw out the plastic wrap! The sticker for registration is stupidly on the wrap.The Asus instructions are basic, and their support is useless, but you should be able to follow the directions to installation on your own.  But use the forums if you need help.This comes with SP2, and that s the highest you should go on disc.  I was able to upgrade to SP3 with no problem with windows update.',5,'2018-01-26',5),
(59,'62a3512341a77a604f0abe3499a0d44a',7,'I bought this because I wanted to run that one application from work that doesn t run on Mac OSX.  Using Boot Camp, I created a Windows partition on my mac, and then installed this version of XP.  It ran great.  I recommend continuing to shut down and restart over and over to be sure all the updates are installed.  Fusion can then boot from the Boot Camp partition.  The downside is that Microsoft seems to think I installed XP on another machine (the virtual one) and won t let me register (I m still in the 30-day grace period).  I haven t called them yet to try to resolve the issue.  It does run great using Boot Camp (my mac is the fastest, prettiest Windows machine I ve ever used).',4,'2018-01-26',4),
(60,'78818825281057648174a43a3269e84b',6,'Ok, like the title says; It s Windows XP SP2. So what don t we all know about it by this point in time?Personally I prefer to use my Macs over my PC, but this purchase was for my dad so he could still use Quicken 2008 and Family Tree Maker on his new iMac. Neither of those programs are well represented on the Mac, so Dad prefers to use Parallels running Windows XP to use the versions from his newly retired Windows notebook. It s a workable but clumsy solution until better Mac versions become available.There nothing new to say about Windows XP SP2 that isn t common knowledge now. It is less expensive to use for running VMs like Parallels because of Microsoft s greedy licensing of Vista that requires purchasing Vista Ultimate, the most expensive version of Vista ($219.99), to be permitted run Vista in a VM. I think that is shameless price gouging on Microsoft s part.',3,'2018-01-26',3),
(61,'62a3512341a77a604f0abe3499a0d44a',8,'Bought to install with Fusion on a mac, and it worked just perfectly!  Since I just wanted to run XP for a few things, like Netflix instant viewing- which works great!! - I didn t want to spend a ton of money on XP and this turned out to be the perfect solution.Shipping from Tigerdirect was SUPER FAST (2 day even though I picked ground) and it installed perfectly.  So glad not to be in Vista :)also - I was really struggling with whether to buy XP Pro instead, which is what I had always had on my pc computers, but Fusion takes over internet connection and other networking issues, so I was glad I saved the $50 by buying home ed. and I hardly notice any difference.',5,'2018-01-26',5),
(62,'7c5520bc58d68ee501992c4bca39a5ac',7,'I bought this product to use on a partition on my iMac.  I use it to run some software that s not available for Macintosh.  So far so good; it runs without any particular problems and the software I use with it seems to run OK too.  As are most things from Microsoft it s clunkier to use than the Macintosh side of the hard drive, e.g files are harder to find, but it does the job.  If you have to use Windows but don t need a lot of extra functions, this is the cheapest way to do it.',3,'2018-01-26',3),
