(88,'5415f114639be9027d7a460c242813bc',3,'I bought this exact model (except my dial has Roman numerals) Rolex 116233, 36MM, Champagne dial, two tone 18K solid gold/stainless steel in May 2012 as a present to myself when I retired.  The Amazon price is very good.  The last time I checked in a jewelry store (about a year ago) this watch was selling for $11,100 so with tax it is going to be about $12,000 out the door.  I bought my watch through a grey dealer for a few hundred dollars less than the Amazon price.I absolutely love the watch, it keeps perfect time and is so beautiful, it still glitters like the day I got it.  I have had a lot of cheap watches that looked nice and shiny when they were new but in just a few months the shiny look wore off and they became dull like all the rest.  This watch will never do that because the gold parts are made of solid 18K gold and the stainless steel is a special blend forged in Rolex s own foundry.One of the fun things about owning a Rolex is the reaction from people when I tell them my watch is a Rolex LOL.  They automatically assume I am very rich (not even close).  Or they act like I just created a new life form or something.  I can t count the number of times strangers (usually happens in check-out lines for some reason) have said "excuse me but what kind of watch is that, it is really beautiful"?  When I tell them it is a Rolex Datejust, they get a "OH MY" look on their face that is quite amusing.  One woman said she was thinking she would like to get one for her husband but after I told her it was a Rolex she said "thats not going to happen now"!  People don t realize that Rolex is actually a entry level watch in the luxury watch market, but it has an aggressive marketing program. There are much more expensive watches being made, but only people who are collectors or into horology are aware of them.Note, a Rolex watch will last a lifetime but they do require maintenance.  They should be sent to Rolex about every 10 years because the movement is like the motor in your car, it is a mechanical device made of gears, bearings and lubricants.  The service currently costs $750 if no parts are required.  That might seem expensive but Rolex will completely dis-assenble, clean and rebuild the movement, replace the mainspring and re-polish the entire watch with their special buffing machines.  You will essentially receive a new watch and it will have a two year unconditional warranty.  The service will take two to four months because Rolex will do extensive testing on the watch to ensure that its accuracy is within Rolex chronographer specs.The history of Rolex and its operating philosophy is very interesting.  The best website to learn about Rolex is "THE ROLEX FORUM".It is the best gift I have ever given myself!Rick',5,'2018-01-26',5),
(89,'10adef48f1dedd4e090fad44a1f43182',3,'It s no SWATCH!!',3,'2018-01-26',3),
