(215,'7b66daa1f0c0732e82c2fd8dff92e4df',12,'Se avete difficolt√† all universit√† e volete cambiare la vostra situazione, non comprate nessun altro libro che questo!Sono uno studente al 3 anno di Ingegneria. Mi impegno tanto ma i risultati che ho avuto fino ad ora non riflettono per niente il mio impegno. Allora cercando su Google sono capitato casualmente sulla pagina di presentazione di questo libro. Era la prima volta che ne sentivo parlare, come dei suoi due Autori, due ragazzi di cui non conoscevo n√© i nomi n√© la storia.Avevo comprato gi√† in passato e-book sul metodo di studio, tecniche di memoria e di concentrazione ma gi√† dalla descrizione di questo libro avevo percepito che si trattava di qualcosa di diverso dalle solite cose fatte solo per venderti di tutto e di pi√π. Incuriosito, ho deciso di acquistarlo. Il risultato? Non ho mai letto un libro grande cos√¨ (400 pagine) in cos√¨ poco tempo. Gli autori danno contenuti veramente rivoluzionari sullo studio, sugli esami, sul modo di prepararli e affrontarti e scavano a fondo sulla psicologia con la quale i professori decidono i voti. Inoltre smontano tutta una serie di luoghi comuni che anche io avevo e danno un metodo di gestione del tempo VERAMENTE UNICO (lo sto gi√† applicando e i risultati sono incredibili). Si vede che √® stato scritto da persone che conoscono bene quello di cui parlano perch√© l hanno provato su di loro prima, dopo mesi e mesi di errori ed esami falliti.I concetti sono davvero tanti e anche se non ho ancora applicato tutto, ho notato un cambiamento assurdo in me e nel mio modo di studiare.Solo una parola: compratelo!',5,'2018-01-26',5),
