(217,'d5f2f7991b83bcb95cd612d30089a501',12,'L‚Äôho conosciuto tramite una pubblicit√† su Facebook e devo dire che inizialmente ero molto titubante‚Ä¶sia perch√© pensavo fosse uno di quei soliti libri di apprendimento rapido e tecniche di memoria che non dicono niente di nuovo e sono pieni di cose difficili da applicare, sia perch√© trattandosi di un libro di 400 pagine sinceramente pensavo che sarebbe rimasto sulla mia scrivania a prendere polvere per molto (gi√† che devo studiare un sacco di libri per l‚Äôuniversit√† ci manca pure questo). Ma dopo l‚Äôennesimo esame andato male e la pressione sempre maggiore dei miei genitori (studio Economia), ho visto in questo libro la mia ultima speranza. E cos√¨ √® stato. Che dire‚Ä¶l‚Äôentusiasmo degli autori mi ha coinvolto nella lettura gi√† dalle prime pagine, sempre usando un linguaggio chiaro, semplice e coinvolgente. L ho letto in 7 giorni e gi√† dopo la met√† ho affrontato MOLTO meglio i miei due esami (non mi sono pi√π fatto bloccare dall‚Äôansia) e grazie allo studio rovesciato e alla tecnica D.R.A.C.O li ho superati brillantemente, recuperando quelli passati. Dire che √® un libro per l‚Äôuniversit√† √® riduttivo. Personalmente, la mia vita √® cambiata completamente dopo averlo letto (in meglio). Se volete svoltare nella vostra vita (da studente e non) questo libro √® INDISPENSABILE!!!!',5,'2018-01-26',5),
