(227,'2ce3819539d29ca7f1b1e86d44a0b37b',15,'Bellissimo libro, scritto davvero bene. Spiega bene senza annoiare le vicende che hanno dato vita agli Spartan e alla guerra UNSC/Covenant, con molti parti avvincenti e mozzafiato. Inoltre il racconto riesce a trasmettere quella tristezza - malinconia - paura che provarono i protagonisti nell affrontare la razza Covenant, tentando invano di salvare Reach dalla vetrificazione."Straconsigliato"',5,'2018-01-26',5),
(228,'7e01a33d07b7a92ee2f9210d328f96ea',11,'Sono un grande Fan della space opera di Halo e leggere questo libro mi ha chiarito numerosi punti oscuri sugli Spartan. Se siete curiosi e vi avvicinate oggi alla saga di Halo vi consiglio di Leggervi questo bellissimo libro e subito dopo giocare Halo Reach con il Team Noble Spartan I coinvolto nell operazione di recupero di un oggetto molto prezioso ;-)Dopo comincia la storia di Halo vera e propria e potreste giocare a Halo CE versione Anniversary (nel pacchetto Master Chief Collection).Il gioco √® vecchio ma √® invecchiato benissimo.Tornando al libro io l ho letteralmente divorato. La traduzione √® dignitosa e lo stile dell autore √® un buon equilibrio tra scene di azione e introspezione psicologica dei personaggi. Tutto ben bilanciato senza mai essere pesante o ripetitivo.Da leggere.',4,'2018-01-26',4),
(229,'d2da1499c51fec08318befcd4843029b',13,'Bellissimo libro, scritto davvero bene. Spiega bene senza annoiare le vicende che hanno dato vita agli Spartan e alla guerra UNSC/Covenant, con molti parti avvincenti e mozzafiato. Inoltre il racconto riesce a trasmettere quella tristezza - malinconia - paura che provarono i protagonisti nell affrontare la razza Covenant, tentando invano di salvare Reach dalla vetrificazione."Straconsigliato"',5,'2018-01-26',5),
(230,'8fb2f60a635a69cb0c9c5995819cc2ee',16,'Fantastico, un piacere leggerlo, e molto facile da seguire.  Ricette poi sempre buonissime e ben riuscite che piacciono a grandi e piccini',5,'2018-01-26',5),
(231,'ebfa9a268b6f9d48acf511f0d0bd84f4',16,'Bel libro. Ci sono diverse ricette semplici e abbastanza veloci. Non c √® una scelta molto varia, ma per la cucina di tutti i giorni pu√≤ tornare utile. Avrei inserito un bel po  di foto in pi√π per le ricette',4,'2018-01-26',4),
(232,'7cdff316bf1fe4bd95e85ba197bb05cd',15,'Da fan della saga non potevo non perdermi questa perla. ben narrato e con un sacco di riferimenti alla saga del celebre videogame, forse talmente tanti che per un neofita potrebbe risultare perisno arduo riconoscerli tutti.Un best seller non solo per il nome che porta ma per essere il prologo di un immenso universo sci-fi, quello di Halo,Consiglio la lettura pertanto, non solo agli appassionati ma a chiunque piaccia il genere fantascentifico e spaziale.',5,'2018-01-26',5),
(233,'2d17c07f514ab4932caaee1d1243d003',14,'A parte il costo che differisce di poco da quello dei super mercati (conveniente solo intorno ai 16‚Ç¨). Non abbiamo trovato problemi tecnici, niente fuori uscite o irritazioni, ma la consistenza e l odore un po  chimico non ci hanno fatto impazzire. Il bambino si lamentava spesso per essere cambiato, cosa che con altre marche solitamente non fa.Ovviamente spedizione ed imballo ottimi.',3,'2018-01-26',3),
(234,'33883719c406f8ac4af56855640e5dbf',16,'Avendo letto il libro non potevo far mancare il film nella videoteca. Bella storia, perfetti nella parte i protagonisti...che dire, buona visione',5,'2018-01-26',5),
(235,'37fa1c40bd3bec977cf6a8ca14f3960f',10,'Non voglio fare l antipatico o il cinefilo: anche a me piace guardare film pi√π leggeri di altri, mi piace fare una risata con gli amici alla "American Pie", mi piace un bello sparatutto senza troppi pensieri per la testa...ma qui secondo me si va oltre le peggiori aspettative.Ho cercato di guardare il film con occhio non eccessivamente critico e devo dire che oltre ad avermi annoiato, lo ho trovato anche raffazzonato negli effetti speciali: le scene di Edward che corre e si arrampica sugli alberi sembrano fatte da un ragazzino con un pc da salotto.I protagonisti: Robert Pattinson √® diventato un sex symbol per le ragazzine e non se ne capisce il motivo, la Stewart √® la fidanzata che nessuno vorrebbe avere...un eterna rompiscatole.La trama: lei √® una ragazzina disadattata, lui un vampiro solitario, si amano e devono uccidere i cattivi.Il BLURAY: un buon comparto tecnico con audio davvero notevole anche se enfatizzato solo nell ultima mezz ora di pellicola.Le due stelle le do solo per la qualit√† audiovideo, altrimenti avrei dato uno per il valore della pellicola.',2,'2018-01-26',2),
